import React, { useState, useEffect } from "react";

const [Loaded, setLoaded] = useState(9);

 
function incrementLoaded() {
    setLoaded((prevLoaded) => prevLoaded + 1);
    console.log(Loaded);
  }

  export default incrementLoaded;
